FontCache::Pair FontCache::Get(UniChar _c)
{
//    if(_c == 0) return FontCache::Pair();
    
    if(cache[_c].searched)
        return cache[_c];
    
    // unknown unichar - as system about it
    
    CGGlyph g;
    bool r = CTFontGetGlyphsForCharacters(ctbasefont, &_c, &g, 1);
    if(r)
    {
        cache[_c].searched = 1;
        cache[_c].glyph = g;
        return cache[_c];
    }
    else
    {
        // need to look up for fallback font
        CFStringRef str = CFStringCreateWithCharacters(0, &_c, 1);
        CTFontRef   ctfont = CTFontCreateForString(ctbasefont, str, CFRangeMake(0, 1));
        CFRelease(str);

//        int a = wcwidth(_c);
//        int b = mk_wcwidth(_c);
        
        // OLOLO!
/*        FILE *f = fopen("/users/migun/1.txt", "wt");
        for(int n =0; n < 65536; ++n)
        {
            if(n > 0 && n % 128 == 0)
                fprintf(f, "\n");
            
            int c = mk_wcwidth(n);
            if(c<1) c = 1;
            
            fprintf(f, "%d,", c);
        }
        fclose(f);
*/
        
        if(ctfont != 0)
        {
            r = CTFontGetGlyphsForCharacters(ctfont, &_c, &g, 1);
            if(r == true) // it should be true always, but for confidence...
            {
                // check if this font is new one, or we already have this one in dictiorany
                for(int i = 1; i < 256; ++i)
                {
                    if( ctfallbacks[i] != 0 )
                    {
                        if( CFEqual(ctfallbacks[i], ctfont) )
                        { // this is just the exactly one we need
                            CFRelease(ctfont);
                            cache[_c].font = i;
                            cache[_c].searched = 1;
                            cache[_c].glyph = g;
                            return cache[_c];
                        }
                    }
                    else
                    {
                        // a new one
                        ctfallbacks[i] = ctfont;
                        cgfallbacks[i] = CTFontCopyGraphicsFont(ctfont, 0);
                        
                        cache[_c].font = i;
                        cache[_c].searched = 1;
                        cache[_c].glyph = g;
                        return cache[_c];
                    }
                }
                assert(0); // assume this will never overflow - we should never came here
                return FontCache::Pair();
            }
            else
            { // something is very-very bad in the system - let this unichar be a null
                CFRelease(ctfont);
                cache[_c].searched = 1;
                return cache[_c];
            }
        }
        else
        { // no luck
            cache[_c].searched = 1;
            return cache[_c];
        }
    }
    
    return FontCache::Pair();
}

